import React from 'react';
import { FormControl } from 'react-bootstrap'
import './Players.css'

const Players = ({playerList}) => {
  return (
    <div>
    <FormControl size="sm" type="name" placeholder="new player" />
    <>
      {playerList.map(player => (<div className="player" key={player}>{player}</div>))}
    </>
    </div>
    
  );
}

export default Players;
